import React from 'react';
import './Display.css'


const Display = ({ tickers }) => {

   
    
    const peoplelist = tickers.length ? tickers.map( person =>{
        
        let {base,target,last,market,volume,trade_url}=person;
        return( <div className='person' key={last}>
        <p><strong>Tickers</strong></p>
        <ul>
            <li>Base: {base}, Target: {target}, Market Name: {market.name}, Volume: {volume}, Trade_URL: {trade_url}</li>
        </ul>
       
        </div>)
    }) : (<p> </p>);//No data found....
    return(
        <div className='display-div'>
            {peoplelist}
        </div>
    );
}
export default Display;
